# Configure this correctly. Otherwise, the prober will not succeed in getting OTA URLs!
# All Android fingerprints follow the following format:
#   <oem>/<product>/<device>:<android_version>/<build_tag>/<incremental>:user/release-keys
#   Nothing/Pacman/Pacman:15/AP3A.240905.015.A2/2505272137:user/release-keys

build_tag: "AP3A.240905.015.A2"       # Example: RKQ1.211119.001
incremental: "2505272137"     # Example: 2206131341
android_version: "15" # Only put in the major version number.
oem: "Nothing"             # The company that made your device (e.g. Samsung)
device: "Pacman"          # The device code. May be same as model code.
model: "A142"           # The model code. (e.g. SM-T380)
product: "Pacman"         # The product code. May be same as device code or model code.
